y={lightTheme:"Светлая тема",darkTheme:"Темная тема"},iy={home:{links:{resume:"Резюме",projects:"Проекты",feedback:"Связь"},welcome:{p1:"Добро пожаловать на мой сайт! Меня зовут <b>Евгений Охватюк (псевдоним SBV)</b> и я занимаюсь веб-разработкой уже более года. Мой основной стек технологий - это React. Я стараюсь создавать веб-приложения, которые были бы красивыми, удобными в использовании и максимально эффективными.",p2:"На этом сайте я представляю свои работы и эксперименты в области веб-разработки. Здесь вы можете ознакомиться с моими проектами и узнать больше о том, как я работаю.",p3:"Будьте уверены, что на моем сайте не собирается никакой личной информации. Если у вас есть какие-либо вопросы, не стесняйтесь обращаться ко мне по электронной почте <b>ohvatuki@gmail.com</b> или по форме обратной связи.",p4:"Спасибо за посещение моего сайта, я надеюсь, что вы найдете здесь много интересного!"}},resume:{title:"Резюме",age:"19 лет",content:{p1:"Меня зовут Евгений Охватюк и я занимаюсь программированием. Проживаю в <b>Беларуси</b>, где получил среднее-специальное образование и квалификацию техника-программиста. Уже полтора года я активно занимаюсь веб-разработкой, и за это время приобрел значительный опыт в данной области.",p2:"Владею <b>HTML, CSS (также препроцессор SASS) и JavaScript, включая синтаксис ES6</b>. В последние полгода занимался написанием приложений на языке <b>TypeScript</b> с использованием библиотек <b>React и Redux TK</b>. Я постоянно совершенствую свои навыки и изучаю что-то новое.",p3:"Однако моя работа не ограничивается только фронтендом. Я также имею опыт работы с серверной частью приложений, используя <b>Node.js и фреймворк Express</b>. Также я знаком с <b>SQL</b>, и у меня есть опыт работы с базой данных (для своих целей использовал <b>PostgreSQL</b>).",p4:"Я готов применять свои знания и навыки веб-разработки в новых проектах и продолжать свой профессиональный рост. Ищу позицию <b>Frontend разработчика</b> в компании, где смогу получить новый опыт и узнать больше о современных технологиях. С нетерпением жду возможности обсудить мою квалификацию и присоединиться к вашей команде."}},feedback:{title:"Связь",email:"Ваш E-Mail",email_placeholder:"E-Mail",message:"Ваше сообщение",message_placeholder:"Сообщение",send:"Отправить"},projects:{title:"Проекты",repo:"Репозиторий",demo:"Демо",page:"Страница",next:"Вперед",back:"Назад"}},oy={version:ty,about:ny,theme:ry,pages:iy,"back-home":"Главная страница"},ay="Version",ly={myname:"Eugene Ohvatuk",job:"Frontend developer"},sy={lightTheme:"Light theme",darkTheme:"Dark theme"},uy={home:{links:{resume:"Resume",projects:"Projects",feedback:"Feedback"},welcome:{p1:"Welcome to my website! My name is <b>Eugene Ohvatuk (nickname SBV)</b> and I've been doing web development for more than a year. My main technology stack is React. I try to create web applications that are beautiful, easy to use and as efficient as possible.",p2:"On this website I present my work and experiments in web development. Here you can read about my projects and learn more about how I work.",p3:"Be assured that no personal information is collected on my site. If you have any questions, feel free to contact me by email <b>ohvatuki@gmail.com</b> or via the feedback form.",p4:"Thanks for visiting my site, I hope you find a lot of interesting things here!"}},resume:{title:"Resume",age:"19 years old",content:{p1:"My name is Eugene Ohvatuk and I specialize in programming. I live in <b>Belarus</b>, where I received a specialized secondary education and qualification as a software technician. For one and a half years I am actively involved in web development, and during this time I have gained considerable experience in this area.",p2:"I am proficient in <b>HTML, CSS (as well as the SASS preprocessor) and JavaScript, including ES6 syntax</b>. In the last six months I've been writing applications in <b>TypeScript</b> using <b>React and Redux TK</b> libraries. I am constantly improving my skills and learning new things.",p3:"However, my work is not limited to the frontend. I also have experience with the server side of applications using <b>Node.js</b> and the <b>Express</b> framework. I am also familiar with <b>SQL</b>, and I have experience with databases (I used <b>PostgreSQL</b> for my purposes).",p4:"I am ready to apply my knowledge and web development skills to new projects and continue my professional growth. I am looking for a <b>Frontend Developer</b> position with a company where I can gain new experience and learn more about modern technologies. I look forward to discussing my qualification and joining your team."}},feedback:{title:"Feedback",email:"Your E-Mail",email_placeholder:"E-Mail",message:"Your message",message_placeholder:"Message",send:"Send"},projects:{title:"Projects",repo:"Repository",demo:"Demo",page:"Page",next:"Next",back:"Back"}},cy={version:ay,about:ly,theme:sy,pages:uy,"back-home":"Home page"};be.use(nm).init({lng:localStorage.getItem("language")??"ru",fallbackLng:"ru",resources:{ru:{translation:oy},en:{translation:cy}}});Yl.createRoot(document.getElementById("root")).render(S(x8,{}));
